import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Route exact path="/">
        <div>Hi</div>
      </Route>
      <Route path="/focus">
        <div>Focus</div>
      </Route>
    </Router>
  );
}

export default App;
